function JS_ConvertPrvKey2WIF(){var e,t,o,n;{e="80"+document.getElementById("prvKey").value,document.getElementById("extPrvKey").value=e;const a=foo.Buffer.from(e,"hex");t=foo.createHash("sha256").update(a).digest(),document.getElementById("firstSHA256").value=t.toString("hex").toUpperCase();const d=foo.Buffer.from(t,"hex");o=foo.createHash("sha256").update(d).digest(),document.getElementById("secondSHA256").value=o.toString("hex").toUpperCase();var r=o.toString("hex").substring(0,8);document.getElementById("CKHSUM").value=r.toUpperCase(),n=e+r,document.getElementById("extPrKeyCKHSUM").value=n.toUpperCase();const u=foo.Buffer.from(n,"hex"),m=foo.base58.encode(u);document.getElementById("wif").value=m}}function createRandomPrvKey(){var e=foo.randomBytes(32);document.getElementById("prvKey").value=e.toString("hex").toUpperCase(),JS_ConvertPrvKey2WIF()}